import navbarLogo from './navbar-logo.png';
import search from './search.png';
import React from 'react';



class Navbar extends React.Component {
    render() {
      return (
        <div className="navbar">
          <div> <img id="home" src={navbarLogo} alt="navbar logo" height="150px" width="200px"/></div>
          <div><input type="text" placeholder= "Search"></input></div>
          <div><img id="explore" src={navbarExplore} alt="Explore icon" height="50px" width="50px"/></div>
          <div><img id="notifications" src={navbarHeart} alt="notification icon" height="40px" width="50px"/></div>
          <div><img id="profile" src={navbarProfile} alt="profile icon" height="40px" width="50px" /></div>
        </div>

      )
    }
  }
  export default Navbar;
